import ValueChanger from "./ValueChanger"
function Section(props){
    console.log(props.property)
    console.log(props.value);
    let valueChangerList = [];
    const sendChange = (newValue) => {
        console.log(props.propert + " : " + newValue);
    }
    for(const [property, value] of Object.entries(props.value)){
       
        valueChangerList.push(
            <ValueChanger key={property} property={property} value={value} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
        )
    }
    return(
        <div>
            {valueChangerList}
        </div>
        
    )
}
export default Section;
